import './Service.css';
import axios from 'axios';
import Board_header from "./../Board_header/Board_header";
import Title from './../Title/Title';
import Board_list from "./../Board_list/Board_list.js";
import {React, useState} from "react";
function Service_Total(){
    const [content, setContent] = useState('');
    window.onload = axios({
        method: "get",
        url: "http://54.180.210.232/api/v1/services/all",
        headers: {
            "Content-Type": "application/json",
            Authorization: "Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJhZG1pbUBhZG1pbi5jb20iLCJhdXRoIjoiUk9MRV9BRE1JTiIsImV4cCI6MTY3MTg2MDQ4MX0.mhZr7r6cZiYR484PDrc-RpanIUe-sHERfhqAAs5gS7SPPS-Kso_SDxExDSd8DkFGEJ-i-SbZBKFaZzxEuj0b0Q"
        },
    }).then((res) => {
        setContent(res.data);
    }).catch((error) => {
        alert("정보를 가져올 수 없습니다");
    });
    return(
        <div className="Service_Top_Wrap">
            <Title title="전체 서비스" />
            <Board_header t1="번호" t2="제목" t3="글쓴이" t4="신청일"/>
            <ul>
                {content===Object(content)
                    ? content.content.map((content, index) => (
                        <li key={index}>
                            <Board_list num={index+1} title={content.title} name={content.writer} />
                        </li>
                    ))
                    : "등록된 글이 없습니다"}
            </ul>
        </div>
    );
}

export default Service_Total;
